wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Your Rights</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We take reasonable steps to ensure that your personal data is accurate, complete, and up to date. You have the right to access, correct, or delete the personal data that we collect. You are also entitled to restrict or object, at any time, to the further processing of your personal data. You have the right to receive your personal data in a structured and standard format. You may lodge a complaint with the competent data protection authority regarding the processing of your personal data. To protect the privacy and the security of your personal data, we may request data from you to enable us to confirm your identity and right to access such data, as well as to search for and provide you with the personal data we maintain. There are instances where applicable laws or regulatory requirements allow or require us to refuse to provide or delete some or all of the personal data that we maintain. You may contact us to exercise your rights. We will respond to your request in a reasonable timeframe, and in any event in less than 30 days.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Third-Party Websites and Services</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>When a customer operates a link to a third-party website that has a relationship with us, we do not assume any obligation or responsibility for such policy because of the third party’s privacy policy. Our websites, products, and services may contain links to or the ability for you to access third-party websites, products, and services. We are not responsible for the privacy practices employed by those third parties, nor are we responsible for the information or content their products and services contain. This Privacy Statement applies solely to data collected by us through our products and services. We encourage you to read the privacy policies of any third party before proceeding to use their websites, products, or services.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Data Security, Integrity, and Retention</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We use reasonable technical, administrative, and physical security measures designed to safeguard and help prevent unauthorized access to your data, and to correctly use the data we collect. We will retain your personal data for as long as it is necessary to fulfill the purposes outlined in this Privacy Statement, unless a longer retention period is required or permitted by law.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Changes to this Privacy Statement</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We may periodically change this Privacy Statement to keep pace with new technologies, industry practices, and regulatory requirements, among other reasons. Your continued use of our products and services after the effective date of the Privacy Statement means that you accept the revised Privacy Statement. If you do not agree to the revised contact us Privacy Statement, please refrain from using our products or services and contact us to close any account you may have created.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Contact Us</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you have any questions regarding this Privacy Statement or its implementation, here is how you can reach us:</p>\n<!-- /wp:paragraph -->", "Privacy Policy", "", "inherit", "closed", "closed", "", "3-revision-v1", "", "", "2024-02-07 02:31:39", "2024-02-07 02:31:39", "", "3", "http://www.cctvwpmb.com/?p=7", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("8", "1", "2024-02-07 02:32:18", "2024-02-07 02:32:18", "<!-- wp:paragraph -->\n<p>To ensure that your package is properly delivered and you receive shipment within the time frame we advertise, please make sure your address is fully entered and is correct. Use correct abbreviations and have spaces inserted properly, we do not take responsibility for incorrect information or orders returned due to incorrect addresses.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>All orders are subject to verification prior to processing and shipping.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We are required to complete a customs declaration with the retail value of the item(s) purchased, we cannot legally declare your order as a gift.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Items we cannot ship internationally are:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Hazardous Materials: Aerosol Spray and Lithium Ion Batteries, Lighters.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Orders of any of these products will be canceled in our system.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Some inventory on our site is held in our U.S official stores, which are not able toship internationally. If your order includes an item only available in a store we will send you an email notification.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The customer assumes the cost of any return shipping for refunds or exchanges.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>During the order verification step we may contact you by email to request additional information.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We will always do our best to assist you, but we do not hold responsibility for packages that are lost or stolen in transit. If you are still unable to locate your package, you must contact the shipping carrier to discuss the issue and file a claim through them.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Delivery time will be affected by public holidays, mailing address, inclement weather and international express company.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>All delivery times are estimates and subject to the courier being able to deliver. Weather and unforeseen events may also cause a small delay.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Delivery time: usually 2-3 days.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Processing time: usually 1 days.</p>\n<!-- /wp:paragraph -->", "Shipping policy", "", "publish", "closed", "closed", "", "shipping-policy", "", "", "2024-02-07 02:32:18", "2024-02-07 02:32:18", "", "0", "http://www.cctvwpmb.com/?page_id=8", "0", "page", "", "0");
