INSERT INTO `wp_posts` VALUES("12", "1", "2024-02-07 02:33:53", "2024-02-07 02:33:53", "<!-- wp:paragraph -->\n<p><strong>Cancellation</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We accept order cancellation before the product is shipped or produced. If the order is cancelled you will get full refund. We cannot cancel the order if the product is already shipped out.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Returns (if applicable)</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We accept return of products. Customers have the right to apply for a return within 14 days after the receipt of the product. To be eligible for a return, your item must be unused and in the same condition that you received it. It must also be in the original packaging. To complete your return, we require a receipt or proof of purchase. Please do not send your purchase back to the manufacturer. Customers will only be charged once at most for shipping costs (this includes returns); No restocking fee to be charged to the consumers for the return of a product.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Refunds (if applicable)</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Once your return is received and inspected, we will email you a notification of receipt. We will also notify you of the approval or rejection of your refund. If you are approved, then your refund will be processed, and a credit will automatically be applied to your credit card or original method of payment, within a certain amount of days.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Late or missing refunds (if applicable)</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you haven’t received a refund yet, first check your bank account again. Then contact your credit card company, it may take some time before your refund is officially posted. Next contact your bank. There is often some processing time before a refund is posted. If you’ve done all of this and you still have not received your refund, please contact us at .</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Please contact our Customer service at to get the return address.</p>\n<!-- /wp:paragraph -->", "Refund and Returns Policy", "", "publish", "closed", "closed", "", "refund-and-returns-policy", "", "", "2024-02-07 02:33:53", "2024-02-07 02:33:53", "", "0", "http://www.cctvwpmb.com/?page_id=12", "0", "page", "", "0");
INSERT INTO `wp_posts` VALUES("13", "1", "2024-02-07 02:33:53", "2024-02-07 02:33:53", "<!-- wp:paragraph -->\n<p><strong>Cancellation</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We accept order cancellation before the product is shipped or produced. If the order is cancelled you will get full refund. We cannot cancel the order if the product is already shipped out.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Returns (if applicable)</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We accept return of products. Customers have the right to apply for a return within 14 days after the receipt of the product. To be eligible for a return, your item must be unused and in the same condition that you received it. It must also be in the original packaging. To complete your return, we require a receipt or proof of purchase. Please do not send your purchase back to the manufacturer. Customers will only be charged once at most for shipping costs (this includes returns); No restocking fee to be charged to the consumers for the return of a product.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Refunds (if applicable)</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Once your return is received and inspected, we will email you a notification of receipt. We will also notify you of the approval or rejection of your refund. If you are approved, then your refund will be processed, and a credit will automatically be applied to your credit card or original method of payment, within a certain amount of days.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Late or missing refunds (if applicable)</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you haven’t received a refund yet, first check your bank account again. Then contact your credit card company, it may take some time before your refund is officially posted. Next contact your bank. There is often some processing time before a refund is posted. If you’ve done all of this and you still have not received your refund, please contact us at .</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Please contact our Customer service at to get the return address.</p>\n<!-- /wp:paragraph -->", "Refund and Returns Policy", "", "inherit", "closed", "closed", "", "12-revision-v1", "", "", "2024-02-07 02:33:53", "2024-02-07 02:33:53", "", "12", "http://www.cctvwpmb.com/?p=13", "0", "revision", "", "0");
